            "CH": "召唤 <color style='color:#f29e38;'>4</color> 个<b>「所有或一无所有」</b>并使我方全体进入赌局，同时自身获得一个随机 1~9 的点数。<br><br>我方单体攻击「所有或一无所有」时，会获得一个随机 1~6 的点数，命中多个会叠加点数。<br><br>下次诡弈砂金行动时，赌局进行结算：<br>· 点数低于诡弈砂金的我方目标输掉赌局，并承受<color style='color:#f29e38;'>【胜者通杀】</color>技能。<br>· 点数高于诡弈砂金的我方目标赢得赌局：获得一个额外回合，并使我方恢复 <color style='color:#f29e38;'>1</color> 个战技点，可叠加。",
            "EN": "Summons <color style='color:#f29e38;'>4</color> <b>All or Nothing</b> and makes all targets enter the gamble, and chooses a random number for himself between 1 and 9.<br><br>When a gambling ally attacks All or Nothing, they will receive a random number between 1 and 6, which stacks when hitting multiple.<br><br>The next time Aventurine of Stratagems takes a turn, the gamble finishes:<br>· Targets with numbers lower than Aventurine of Stratagems will lose the bet and suffer from the skill <color style='color:#f29e38;'>The Winner Takes It All</color>.<br>· Targets with numbers higher than Aventurine of Stratagems win the bet and will receive 1 extra turn and recovers <color style='color:#f29e38;'>1</color> Skill Point for the team, stackable."
